import { useFormik } from "formik";
import { FunctionComponent } from "react";
import * as yup from "yup";
import User from "../interfaces/user";
import { errorMsg } from "../services/feedbacks";
import { AddUser } from "../services/userService";
import Footer from "./footer";

interface BusinessSignUpProps{

}

const BusinessSignUp: FunctionComponent<BusinessSignUpProps> = () => {
    let formik = useFormik({
        initialValues:{
            name: "",
            email: "",
            password: "",
            isBusiness: true
        },
        validationSchema: yup.object({
            name: yup.string().required().min(2),
            email: yup.string().required().email(),
            password: yup.string().required().min(8)
        }),
        onSubmit: (values: User) =>{
            AddUser(values)
            .then(() => {  })
            .catch((err) => errorMsg(`${err} allready used`));
        }
    })
    return <>
    <div className="">
        <div style={{height:"84.5vh", marginRight:"0"}} className="row">
            <div style={{padding: "50px"}} className="container col-md-4 mt-5">
                <h1 className="display-4 text-center" >SIGN UP</h1>
                <p className="text-center" >Creat free Business acount</p>
                <form onSubmit={formik.handleSubmit}> 
                <div className="form-floating mb-3">
                <input
                    type="email"
                    className="form-control"
                    id="floatingInput"
                    placeholder="example@test.com"
                    name="email"
                    value={formik.values.email}
                    onChange={formik.handleChange}
                    onBlur={formik.handleBlur}
                />
                <label htmlFor="floatingInput">Email</label>
                {formik.touched.email && formik.errors.email && (
                    <small className="text-danger">{formik.errors.email}</small>
                )}
                </div> 
                <div className="form-floating mb-3">
                    <input
                    type="text"
                    className="form-control"
                    id="floatingInput"
                    placeholder="example@test.com"
                    name="name"
                    value={formik.values.name}
                    onChange={formik.handleChange}
                    onBlur={formik.handleBlur}
                    />
                    <label htmlFor="floatingInput">Name</label>
                    {formik.touched.name && formik.errors.name && (
                    <small className="text-danger">{formik.errors.name}</small>
                    )}
                </div>
                <div className="form-floating mb-3">
                    <input
                    type="password"
                    className="form-control"
                    id="floatingInput"
                    placeholder="example@test.com"
                    name="password"
                    value={formik.values.password}
                    onChange={formik.handleChange}
                    onBlur={formik.handleBlur}
                    />
                    <label htmlFor="floatingInput">password</label>
                    {formik.touched.password && formik.errors.password && (
                    <small className="text-danger">{formik.errors.password}</small>
                    )}
                </div>
                <button type="submit" className="btn btn-primary w-100" disabled={!formik.dirty || !formik.errors}>Sign up</button>
                </form>
            </div>

            <div style={{padding:"0"}} id="pic" className="col-md-7">
                        <img style={{height: "85vh"}} className="w-100" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTy4k7clv9pIuHkXhUqHbtvLeAOUqB-VpznfZzWRWJnvQeCbSgcJ2TGyfJggJhqo3LSol0&usqp=CAU" alt="" />
            </div>

        </div>
    </div>
    <Footer />
    </>
}

export default BusinessSignUp;
